function SetHome(e,n){try{e.style.behavior="url(#default#homepage)",e.setHomePage(n)}catch(t){if(window.netscape)try{netscape.security.PrivilegeManager.enablePrivilege("UniversalXPConnect")}catch(t){alert("抱歉，此操作被浏览器拒绝！\n\n请在浏览器地址栏输入'about:config'并回车然后将[signed.applets.codebase_principal_support]设置为'true'")}else alert("抱歉，您所使用的浏览器无法完成此操作。\n\n您需要手动将【"+n+"】设置为首页。\n\n少儿馆感谢您的关注！")}}function AddFavorite(e,n){try{window.external.addFavorite(n,e)}catch(t){try{window.sidebar.addPanel(e,n,"")}catch(t){alert("抱歉，您所使用的浏览器无法完成此操作。\n\n加入收藏失败，请使用Ctrl+D进行添加。\n\n少儿馆感谢您的关注！")}}}